import React from "react";
import Navigation from "../../components/Navigation";

const Home = () => {
    return (
        <>
            <Navigation />
            <section className="container mx-auto px-4">
                <div className=" h-screen border-2 space-y-6">
                    <div>
                        <img src={require("../../assets/img/herosection.png")} />
                    </div>
                    <div className="space-y-2">
                        <h1 className="text-3xl font-bold">Find your dream job</h1>
                        <p className="mb-4">Temukan pekerjaan impian anda dan kembangkan karir anda</p>
                        <button className="border-2 border-primary text-primary p-2 rounded-md">
                            find jobs <i class="fa-solid fa-arrow-right"></i>
                        </button>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Home;
